import React from 'react';

const listData = [];
for (let i=0; i < 5; i++) {
  listData.push({
    index: i,
    name: "This is user: " + i,
    score: i * 10,
    game: 'poker'
  });
}

const Player = (props) => {
  
  list = listData.map((item) => 
    < li key = { item.index } > Name: { item.name }, Score: { item.score }, Game: { item.game }</li >
  );
  
  return (
    <ul>
      {listData.map(function(item){
        return <li key={item.index}>Name: {item.name}, Score: {item.score}, Game: {item.game}</li>;
      })}
    </ul>
  );
}

export default Player;
